class Solution(object):
    def find132pattern(self, nums):
        visited = set()
        for i, v in enumerate(nums):
            for j in range(i+1, len(nums)-1):
                if v+1 >= nums[j] or (v, nums[j]) in visited:
                    continue
                for k in range(j+1, len(nums)):
                    if v < nums[k] < nums[j]:
                        return True
                visited.add((v, nums[j]))
                print(visited)
        return False


